 made her feel well. We chatted for a bit & parted ways. We happened to cash out at the same time and I said “Bye Connie!” And she replied in the same raspy New York diner server voice (if you know you know) “Bye Baby!” I encourage you to get to know those in your neighborhood or if there is someone you haven’t seen in a while go to them and say hi or even text or call. You never know who’s day you’ll make! • #storytelling #memories #tgif #friyay #eastorlando #dennys #diner #momlife #motherhood #motherhoodunplugged #motherhoodrising #momsofinstagram #motherhoodthroughinstagram #mommyblogger #mommyvlogger #mompreneur #mominfluencer #doula #momofalltrades #motherhustler #bestoftheday #thatsdarling #orlandomom #orlando #thatsdarling";}i:186;a:1:{s:14:"comments_count";i:2;}i:187;a:1:{s:11:"likes_count";i:17;}i:188;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEvFFQvhoBl";}i:189;a:1:{s:5:"image";s:250:"https://scontent-sin6-2.cdninstagram.com/v/t51.2885-15/e35/s1080x1080/118699194_3193905740699240_2716030326395942598_n.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=108&_nc_ohc=5fELHPpYYAQAX-tjsm-&oh=6063aedfc35034b10720e42428865fee&oe=5F7C60F7";}i:190;a:1:{s:4:"type";s:5:"image";}i:191;a:1:{s:8:"owner_id";i:3323220;}i:192;a:1:{s:14:"owner_username";s:0:"";}i:193;a:1:{s:14:"owner_fullname";s:0:"";}i:194;a:1:{s:9:"owner_pic";s:0:"";}i:195;a:1:{s:2:"id";s:19:"2391148961180397989";}i:196;a:1:{s:10:"short_code";s:11:"CEvEU-0M7Gl";}i:197;a:1:{s:12:"created_time";i:1599267190;}i:198;a:1:{s:7:"caption";s:848:"🔪KILL BILL💣

